import React from 'react';
import { useNavigate } from 'react-router-dom';

interface props {
    content: string;
}

export const Navbar = ({ content }: props) => {
    const navigate = useNavigate();
    const handleClickBack = () => navigate(-1);
    const handleClickFofward = () => navigate(1);

    return (
        <div className="flex justify-center items-center static bg-orange-400 py-6 text-2xl ">
            <div
                className="absolute  left-20 rounded"
                onClick={handleClickBack}
            >
                <svg
                    xmlns="http://www.w3.org/2000/svg"
                    width="36"
                    height="36"
                    fill="currentColor"
                    className="rounded-lg bi bi-chevron-left bg-green-500 hover:bg-indigo-600 "
                    viewBox="0 0 16 16"
                >
                    <path
                        fill-rule="evenodd"
                        d="M11.354 1.646a.5.5 0 0 1 0 .708L5.707 8l5.647 5.646a.5.5 0 0 1-.708.708l-6-6a.5.5 0 0 1 0-.708l6-6a.5.5 0 0 1 .708 0z"
                    />
                </svg>
            </div>

            <div className="absolute  left-32 " onClick={handleClickFofward}>
                <svg
                    xmlns="http://www.w3.org/2000/svg"
                    width="36"
                    height="36"
                    fill="currentColor"
                    className="bi bi-chevron-right bg-green-500  hover:bg-indigo-600"
                    viewBox="0 0 16 16"
                >
                    <path
                        fill-rule="evenodd"
                        d="M4.646 1.646a.5.5 0 0 1 .708 0l6 6a.5.5 0 0 1 0 .708l-6 6a.5.5 0 0 1-.708-.708L10.293 8 4.646 2.354a.5.5 0 0 1 0-.708z"
                    />
                </svg>
            </div>

            <p>{content}</p>
        </div>
    );
};
